import React from "react";
import Banner from "./Banner/Banner";
import OnTheAir from "./RowPost/OnTheAir";
function TVShows() {
  return (
    <div>
      <Banner />
      <OnTheAir title="Now on LIVE"/>
      
    </div>
  );
}

export default TVShows;
